        /// <summary>
        /// Metodo que obtiene los articulos a buscar
        /// </summary>
        /// <param name="Articulo">string - El articulo a buscar</param>
        public async Task<List<Articulo>> ObtenListaBusqueda(string Articulo)
        {
            List<Articulo> LstBusqueda = new();
            int TipoBusqueda = 0;
            string ImgArticuloNoEncontradoAnt = "";
            string ImgArticuloNoEncontradoNueva = "";
            string ImgBajoCosto = "";
            try
            {
                using var hClient = new HttpClient();
                var client = new API(hClient);
                client.BaseUrl = App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblConfiguracion", "API", "Valor");
                if (App.Funciones.IsNumeric(Articulo))
                    TipoBusqueda = 1; //busqueda por codigo
                else
                    TipoBusqueda = 2; //busqueda por nombre 

                List<TblSesion> Session = App.ServiciosBD.ObtenerListaEntidadLocal("TblSesion").OfType<TblSesion>().ToList();
                string token = App.ServiciosBD.ObtenerListaEntidadLocal("TblSesion").OfType<TblSesion>().ToList().Count <= 0 ? "" : App.ServiciosBD.ObtenerListaEntidadLocal("TblSesion").OfType<TblSesion>().ToList()[0].Token; //"02ae647271b44e46904fa520f6126b35"; 
                int SucursalVirtual = Convert.ToInt32(App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblConfiguracion", "SUCURSAL_VIRTUAL", "Valor"));
                int ClienteVirtual = Convert.ToInt32(App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblConfiguracion", "CLIENTE_VIRTUAL", "Valor"));
                int CajaVirtual = Convert.ToInt32(App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblConfiguracion", "CAJA_VIRTUAL", "Valor"));
                var ResArticulosBusqueda = await client.BusquedaArticuloAsync(token, 1, SucursalVirtual, CajaVirtual, Articulo, TipoBusqueda, Articulo, ClienteVirtual);

                if (ResArticulosBusqueda != null)
                {
                    if (ResArticulosBusqueda.Data.Count <= 0)
                    {
                        var ResArticulosBusqueda2 = await client.BusquedaArticuloAsync(token, 1, SucursalVirtual, CajaVirtual, Articulo, (TipoBusqueda == 2 ? 1 : 2), Articulo, ClienteVirtual);
                        ResArticulosBusqueda = ResArticulosBusqueda2;
                    }
                }

                if (ResArticulosBusqueda != null)
                {
                    foreach (Arts Art in ResArticulosBusqueda.Data)
                    {
                        List<ReqInfoArt> LstCar = new List<ReqInfoArt>();
                        if (Art.Caracteristicas != null)
                        {
                            foreach (Caract IA in Art.Caracteristicas)
                                LstCar.Add(new ReqInfoArt(IA.Nombre, IA.Descripcion, IA.Orden));
                        }

                        Articulo AA = new(
                        Art.Id,
                        Art.Nombre,
                        Art.Precio,
                        Art.Precio_Maximo,
                        Art.Precio_Unitario,
                        Art.Desc_Monto,
                        Art.Desc_Monto,
                        Art.Desc_Porc,
                        Art.Desc_Porc,
                        (Art.Desc_Nombre == null ? "" : Art.Desc_Nombre.ToUpper()),
                        Art.IVA_Monto,
                        Art.IVA_Porc,
                        Art.IEPS_Monto,
                        Art.IEPS_Porc,
                        Art.Cantidad,
                        (Art.Promocion == null ? "" : Art.Promocion.ToUpper()),
                        App.Funciones.Base64aImagen((Art.Imagen == null || Art.Imagen == ImgArticuloNoEncontradoAnt ? ImgArticuloNoEncontradoNueva : Art.Imagen)),
                        (Art.Imagen == null || Art.Imagen == ImgArticuloNoEncontradoAnt ? ImgArticuloNoEncontradoNueva : Art.Imagen),
                        0, 0, 0, (Art.Precio_Unitario + Art.IVA_Monto), 0,
                        LstCar,
                        Art.Tiene_Serie,
                        Art.Tiene_Caducidad,
                        Art.Articulo_Suelto,
                        Art.Costo_Unitario,
                        Art.Articulo_Regalo,
                        true,
                        Art.Promocion_Base,
                        Art.Promocion_Regalo,
                        false,
                        Art.Controlado,
                        "",  //Campo para guardar el lote caducidad
                        0,   //campo para el porcentaje descuento lote
                        false,  // nuevo campo pra condiconar la visibilidad del lote
                        App.Funciones.Base64aImagen(ImgBajoCosto),
                        (ImgBajoCosto),
                        (App.ServiciosBD.ObtenerRegistroEntidadLocal("TblFavoritos", Art.Id).Count() > 0 ) ? App.Funciones.Base64aImagen(App.Funciones.LogoFavoritosSolido) : App.Funciones.Base64aImagen(App.Funciones.LogoFavoritosVacio));
                        LstBusqueda.Add(AA);
                    }
                    
                    return LstBusqueda;
                }
                else
                    return LstBusqueda;
            }
            catch (Exception ex)
            {
                System.Console.WriteLine(ex.Message);
                return LstBusqueda;
            }
        }

