        /// <summary>
        /// Se obtiene la respuesta de la Api "Socio_Frecuente_ListaSocioBusqueda" 
        /// </summary>
        /// <param name="pEmp_Id">Empresa</param>
        /// <param name="pSuc_Id">Sucursal</param>
        /// <param name="pCaja_Id">Caja</param>
        /// <param name="pFiltro">Filtro para la búsqueda</param>
        /// <returns></returns>
        public async Task<ResConsultaSocioFrecuente> Consulta_SocioFrecuente(int pEmp_Id, int pSuc_Id, int pCaja_Id, string pFiltro)
        {
            ResConsultaSocioFrecuente ResConsultaSocioFrecuente = new();

            try
            {
                using var hClient = new HttpClient();
                var client = new API(hClient);

                client.BaseUrl = App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblConfiguracion", "API", "Valor");

                string token = App.ServiciosBD.ObtenerListaEntidadLocal("TblSesion").OfType<TblSesion>().ToList().Count <= 0 ? "" : App.ServiciosBD.ObtenerListaEntidadLocal("TblSesion").OfType<TblSesion>().ToList()[0].Token;
                var ResObtenerConsultaSocioFrecuente = await client.Socio_Frecuente_ListaSocioBusquedaAsync(token, pEmp_Id, pSuc_Id, pCaja_Id, pFiltro);
                ResConsultaSocioFrecuente.IsSuccessful = ResObtenerConsultaSocioFrecuente.IsSuccessful;
                ResConsultaSocioFrecuente.Message = ResObtenerConsultaSocioFrecuente.Message;
                string myData = ResObtenerConsultaSocioFrecuente.Data;
                ResConsultaSocioFrecuente.DataL = new();

                String[] Detalle = myData.Split("}");
                for (int i = 0; i <= Detalle.Length - 1; i++)
                {
                    Detalle[i] = Detalle[i].Replace("{", "").Replace("}", "").Replace("[", "").Replace("]", "").Replace("\"", "");
                    String[] CamposDetalle = Detalle[i].Split(",");
                    if (Detalle[i] != "")
                    {
                        ConsultaSocioFrecuenteDetalle ResSocioDet = new(App.Funciones.BuscaValorArray(CamposDetalle, "Correo"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Nombre"),
                                                                                       Convert.ToInt32(App.Funciones.BuscaValorArray(CamposDetalle, "Socio")),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Tarjeta"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Telefono"));
                        ResConsultaSocioFrecuente.DataL.Add(ResSocioDet);
                    }

                }

                return ResConsultaSocioFrecuente;
            }
            catch (Exception ex)
            {
                await App.Current.MainPage.DisplayAlert("Falló al obtener los datos del monedero", ex.Message, "ok");
                return null;
            }

        }

