        /// <summary>
        /// Se obtiene la respuesta de la Api "BonificacionMonederoAsync" para bonificar al Monedero
        /// </summary>
        /// <param name="pEmp_Id"></param>
        /// <param name="pAutorizador_Id"></param>
        /// <param name="pSuc_Id"></param>
        /// <param name="pCaja_Id"></param>
        /// <param name="pTicket"></param>
        /// <param name="pReferencia"></param>
        /// <param name="pCajero"></param>
        /// <param name="pMonto"></param>
        /// <param name="pOrigen"></param>
        /// <param name="pProductos"></param>
        /// <param name="pTipoDoc_id"></param>
        /// <param name="pCliente"></param>
        /// <param name="pNo_Acumula_Lealtad"></param>
        /// <param name="pListaFormaPago"></param>
        /// <returns></returns>
        public async Task<ResBonificacionMonedero> ObtenerBonificacionMonedero(int pEmp_Id, int pAutorizador_Id, int pSuc_Id, int pCaja_Id, int pTicket, long pReferencia, string pCajero, decimal pMonto, string pOrigen, string pProductos, int pTipoDoc_id, string pCliente, bool pNo_Acumula_Lealtad, string pListaFormaPago)
        {
            ResBonificacionMonedero ResBonificacionMonedero = new();

            try
            {
                using var hClient = new HttpClient();
                var client = new API(hClient);
                client.BaseUrl = App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblConfiguracion", "API", "Valor");
                string token = App.ServiciosBD.ObtenerListaEntidadLocal("TblSesion").OfType<TblSesion>().ToList().Count <= 0 ? "" : App.ServiciosBD.ObtenerListaEntidadLocal("TblSesion").OfType<TblSesion>().ToList()[0].Token;

                var ResObtenerBonificacionMonedero = await client.BonificacionMonederoAsync(token, pEmp_Id, pAutorizador_Id, pSuc_Id, pCaja_Id, pTicket, pReferencia, pCajero, pMonto, pOrigen, pProductos, pTipoDoc_id, pCliente, pNo_Acumula_Lealtad, pListaFormaPago);
                ResBonificacionMonedero.IsSuccessful = ResObtenerBonificacionMonedero.IsSuccessful;
                ResBonificacionMonedero.Message = ResObtenerBonificacionMonedero.Message;
                string myData = ResObtenerBonificacionMonedero.Data;
                ResBonificacionMonedero.DataL = new();

                String[] Detalle = myData.Split("}");
                for (int i = 0; i <= Detalle.Length - 1; i++)
                {
                    Detalle[i] = Detalle[i].Replace("{", "").Replace("}", "").Replace("[", "").Replace("]", "").Replace("\"", "");

                    String[] CamposDetalle = Detalle[i].Split(",");

                    if (Detalle[i] != "")
                    {
                        BonificacionMonederoDetalle ResBonificacionDet = new(App.Funciones.BuscaValorArray(CamposDetalle, "Articulo"),
                                                                                       int.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "No_Cobradas")),
                                                                                       bool.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Exitoso")),
                                                                                       int.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "CodigoRespuesta")),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Articulo_Id"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Autorizacion"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Operador"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Mensaje1"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Mensaje2"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Mensaje3"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "ImpresionTicket"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "NoSecUnico"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Transaccion"),
                                                                                       int.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Visitas")),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Fecha"),
                                                                                       decimal.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Saldo")),
                                                                                       decimal.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "MontoOriginalDevolucion")),
                                                                                       decimal.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Acumula")),
                                                                                       decimal.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Premio")),
                                                                                       decimal.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Devolucion")),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Cliente"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "FechaRespuesta"),
                                                                                       decimal.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "CargoXServicio")),
                                                                                       int.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Tipo")),
                                                                                       bool.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Registrada")),
                                                                                       bool.Parse(App.Funciones.BuscaValorArray(CamposDetalle, "Activa")),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "Laboratorio"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "LstCupon"),
                                                                                       App.Funciones.BuscaValorArray(CamposDetalle, "HoraServicio"),
