                int CajaVirtual = Convert.ToInt32(App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblConfiguracion", "CAJA_VIRTUAL", "Valor"));

                string ClienteGeneral = App.ServiciosBD.ObtenerDatoRegistroEntidadLocal("TblGeneralesVenta", "TipoCliente", "Valor");
                int ClienteBusqueda = ClienteVirtual.ToString() == ClienteGeneral || ClienteGeneral == "" ? ClienteVirtual : Convert.ToInt32(ClienteGeneral);
                var ResPromociones = await client.PromocionVentaAsync(token, Empresa, SucursalVirtual, CajaVirtual, ClienteBusqueda, pDetalle);
                var options = new JsonSerializerOptions { WriteIndented = true };
